import React from 'react';
import { Typography, Link, Grid, CssBaseline, Paper, Avatar, TextField, Button, Box } from '@mui/material';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';

// Composant MadeWithLove
const MadeWithLove = () => (
  <Typography variant="body2" color="textSecondary" align="center">
    {'Built with love by the '}
    <Link color="inherit" href="https://material-ui.com/">
      Material-UI
    </Link>
    {' team.'}
  </Typography>
);

// Composant SignInSide
const SignInSide = () => {
  return (
    <Grid container component="main" sx={{ height: '100vh' }}>
      <CssBaseline />
      <Grid item xs={false} sm={4} md={7} sx={{
        backgroundImage: 'url(https://source.unsplash.com/random)',
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover',
        backgroundPosition: 'center'
      }} />
      <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
        <Paper sx={{
          margin: (theme) => theme.spacing(8, 4),
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          padding: (theme) => theme.spacing(2)
        }}>
          <Avatar sx={{
            margin: (theme) => theme.spacing(1),
            backgroundColor: (theme) => theme.palette.secondary.main,
          }}>
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            Sign in
          </Typography>
          <Box component="form" sx={{ width: '100%', marginTop: 1 }} noValidate>
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              id="email"
              label="Email Address"
              name="email"
              autoComplete="email"
              autoFocus
            />
            <TextField
              variant="outlined"
              margin="normal"
              required
              fullWidth
              name="password"
              label="Password"
              type="password"
              id="password"
              autoComplete="current-password"
            />
            {/* Ajoutez d'autres champs de TextField ici */}
            <Button
              type="submit"
              fullWidth
              variant="contained"
              color="primary"
              sx={{ margin: (theme) => theme.spacing(3, 0, 2) }}
            >
              Sign In
            </Button>
            <Grid container>
              <Grid item xs>
                <Link href="#" variant="body2">
                  Forgot password?
                </Link>
              </Grid>
              <Grid item>
                <Link href="/signup" variant="body2">
                  {"Vous n'avez pas de compte? Creer votre compte"}
                </Link>
              </Grid>
            </Grid>
            <MadeWithLove />
          </Box>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default SignInSide;
